window.bookSummaryJSON = "<p><b>The explosive new addition to the DDVN World (Fire and Ice series) by </b><b><i>USA Today</i></b><b> best-selling author K. F. Breene!</b></p> <p>Something has always been missing from my life. A hole that I could never seem to fill.</p> <p>When I accidentally turn a coven of witches into nightmares, I find out what that something is.</p> <p>Magic.</p> <p>And it turns out, I have a crap load of it.</p> <p>As a latent power awakens deep inside of me, I'm exposed to one of the most powerful and corrupt organizations in the magical world - the Mages' Guild.</p> <p>Barely knowing a spell from a few swear words and luck, I won't be able to evade them alone.</p> <p>And that's when I meet him.</p> <p>The Rogue Natural. The best and most feared mage in the world.</p> <p>He's dangerous, mysterious, and has a vendetta of his own. He is now the only thing between me and magical enslavement.</p>"; 
